INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (8, 143, 'Adaptability', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (23, 157, 'Trust', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (9, 144, 'People are willing to give their best in our organisation ', 'en', '2018-08-30 08:13:46.735543', '2018-11-19 10:32:33.011000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (53, 149, '', 'zh', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (68, 181, 'To be innovative means to create new commercialized solutions for customers. Innovation is everyones job, not only for those who design products.', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (69, 182, 'Train your leaders in how to facilitate an innovation workshop and start using the WeCan innovation tool.', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (147, 240, 'Employee', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (148, 240, '', 'zh', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (83, 195, 'Everything is done inside a certain time frame. Whatever we put into that fram, we get out. Since time is ticking on how we use our time is one of the most crucial determinants of success.', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (84, 196, 'Make a clear list of 5 most important priorities for all company departments and train people about why these priorities are so important.', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (86, 198, 'Priorities and individual time management affects team output and thereby to the entire culture of company. When people know more exactly how they should use their time, they will use less energy for better output. Purposeful individual time usage requires knowledge and acceptance about what our company is all about and what goal we have.', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (87, 199, 'Go through with every employee their main tasks and priorities, explaining why certain priorities are more important than others.', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (89, 201, 'Every person has their own special talents, skills and roles. The more people can focus on doing the work that comes most naturally to them, the better will the productivity be.', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (90, 202, 'Train your employees to focus on their tasks and openly delegate things to the right person when something is not working well for them.', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (103, 215, 'We are different as human beings, with different needs and strenghts. It is important to know why and how we are different, so that we can create a safe culture inside our company.', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (104, 216, 'Conduct a culture survey and map the entire staff according to their traits, competencies, skills and experiences.', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (106, 218, 'Having a clear vision and working according to company values are two of the most important components of excellence. Values should be understood on a practical level so that people understand what is expected of them.', 'en', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (75, 188, 'We concentrate on producing and adding value to our customers', 'en', '2018-08-30 08:13:46.735543', '2018-11-20 08:59:48.657000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (76, 189, 'We are good at combining customer value and profitability', 'en', '2018-08-30 08:13:46.735543', '2018-11-20 08:59:54.244000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (80, 193, 'We are constantly tracking and adapting to customer demands', 'en', '2018-08-30 08:13:46.735543', '2018-11-19 10:40:35.390000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (77, 190, 'Our customers are loyal to us', 'en', '2018-08-30 08:13:46.735543', '2018-11-20 08:59:59.060000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (78, 191, 'Our products / services are easy to understand and purchase', 'en', '2018-08-30 08:13:46.735543', '2018-11-20 09:00:03.820000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (92, 204, 'I am able to work according to agreed priorities', 'en', '2018-08-30 08:13:46.735543', '2018-11-20 09:00:09.978000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (93, 205, 'We delegate efficiently when useful to do so', 'en', '2018-08-30 08:13:46.735543', '2018-11-20 09:00:14.824000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (95, 207, 'I have the necessary tools to succeed in my work', 'en', '2018-08-30 08:13:46.735543', '2018-12-10 03:53:59.198000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (94, 206, 'We are good at keeping schedules', 'en', '2018-08-30 08:13:46.735543', '2018-11-20 09:00:19.848000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (97, 209, 'We have useful and lean processes ', 'en', '2018-08-30 08:13:46.735543', '2018-12-10 03:54:12.394000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (96, 208, 'Our IT-systems as  a whole are easy to use', 'en', '2018-08-30 08:13:46.735543', '2018-11-20 09:00:23.855000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (81, 194, 'Superior Customer Experience', 'en', '2018-08-30 08:13:46.735543', '2018-09-25 12:45:11.566000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (101, 213, 'I know exactly what my roles and responsibilities are', 'en', '2018-08-30 08:13:46.735543', '2018-12-10 03:54:31.854000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (99, 211, 'We have effective shared practices', 'en', '2018-08-30 08:13:46.735543', '2018-11-20 09:00:33.061000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (73, 186, 'Our product/service development is customer focused', 'en', '2018-08-30 08:13:46.735543', '2018-11-20 08:59:44.422000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (61, 167, '', 'zh', '2018-08-30 08:13:46.735543', '2018-12-12 07:14:32.209000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (74, 187, 'Our customer considers us superior to our competitors', 'en', '2018-08-30 08:13:46.735543', '2019-01-25 04:20:35.709000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (57, 153, '', 'zh', '2018-08-30 08:13:46.735543', '2018-12-12 07:11:29.798000', false);
