INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (432, 568, '<p><h2>1 Rekisterinpitj</h2><p>weCan5 Oy, y-tunnus 2082238-6, osoite c/o Renesans Consulting Oy, Kasarmikatu 36, 00130 Helsinki.</p><h2>2 Yhteyshenkil rekisteri koskevissa asioissa</h2><p>Jos sinulla on kysyttv tai huolia siit, miten ksittelemme henkiltietojasi tai tst tietosuojaselosteesta yleisesti, tai jos haluat esitt oikeuksiesi kyttmist koskevan pyynnn, ota meihin yhteytt:</p><p>Lasse Wendelin, lasse.wendelin@wecan5.com,  + 86 130 6274 8040 ja + 358 400 241190.</p><h2>3 Rekisterin nimi</h2><p>weCan-verkkopalveluiden (jljempn "sovellus" tai "palvelu") rekisteri ja tietokanta</p><h2>4 Henkiltietojen ksittelyn tarkoitus</h2><p>Rekisteri on weCan-sovelluksen rekisteri ja tietokanta:</p><ul><li>Sovelluksien rekisteri tarkoittaa palveluiden vlimuistiin tallennettuja tietoja.</li><li>Sovelluksien tietokanta tarkoittaa palveluiden tietokantaan tallennettuja tietoja.</li></ul><p>Rekisterin henkiltietoja ksitelln EU:n tietosuoja-asetuksen 2016/679  mukaisesti palveluissa tapahtuneen tietojenksittelyn oikeellisuuden osoittamiseksi ja muutoin palvelujen tuottamiseksi ja kehittmiseksi sek niiden toimivuudesta ja tietoturvallisuudesta huolehtimiseksi.</p><p>Rekisterin avulla pidetn yll tietoa niist kyttjist, jotka ovat rekisterityneet palveluun ja tallentaneet omia asetuksiaan (oma profiili). Rekisterin avulla pidetn mys yll tietoa palveluiden kytst. </p><p>Palveluihin kirjautuminen edellytt tunnistautuneen kyttjn henkiltietojen tallentamista (shkpostiosoite, nimi, puhelinnumero, ik ja sukupuoli). </p><p>Rekisterin tietoja ksitelln palveluiden kyttjien yksilimiseksi ja palveluissa ksiteltvien henkiltietojen suojaamiseksi ja tietoturvallisuuden varmistamiseksi, virhetilanteiden selvittmiseen sek mahdollisten vrinkytsten ja tietosuojaloukkausten selvittmiseen.</p><p>Rekisteri yllpidetn mys seuraaviin tarkoituksiin: </p><ul><li>Sovelluksen kytn mrn sek kustannusten seurannan ja jaon selvittminen;</li><li>Kytn tilastointitarpeisiin. Tilastointitarpeisiin tietoja kytettess tiedot julkaistaan siten, ett yksittinen henkil ei ole tunnistettavissa;</li><li>Sovelluksen tarjoaminen, personointi ja kehittminen;</li><li>Sovelluksen toimivuuden varmistaminen, uusien ominaisuuksien ja toiminnallisuuksien kehittminen ja tuen tarjoaminen;</li><li>Sovelluksen kytn tutkiminen, analysointi ja kyttn liittyvien tilastojen laatiminen;</li><li>Kyttjsuhteen hallinnoimiseksi tarpeellinen viestint.</li></ul><h2>5 Rekisterin tietosislt</h2><p>Henkiltiedoista tallennetaan rekisteriin seuraavat tiedot:</p><ul><li>nimi, ryhm, shkpostiosoite, puhelinnumero, kieli, sukupuoli, ik, tysuhteen kesto, toimiala, maa, aikavyhyke ja salasana;</li><li>vastaukset palveluiden kysymyksiin ja siihen liittyv statistiikka;</li><li>palveluiden hydyntmiseen tarpeelliset, vlimuistiin tallennettavat tiedot;</li><li>kyttjn tekemt omat asetukset, IP-osoite ja vieraillut sivut tilastointia varten;</li><li>tapahtumatietojen aikaleimat;</li><li>palveluun toimitettavat viestit;</li><li>tapahtumatietorekisterin tietyt tiedot ja niiden selitteet.</li></ul><p>Kirjautumisen osalta tallennetaan tieto kirjautumisen onnistumisesta tai eponnistumisesta. Jos asiointitapahtuma keskeytyy virheen vuoksi, tallennetaan tieto virheen syyst.</p><h2>6 Snnn mukaiset tietolhteet</h2><p>Asiakkaaseen liittyvi tietoja kertn asiakkaalta itseltn sopimuksen tekemisen yhteydess, sovelluksien oma profiili -osiossa, palvelujen kytn yhteydess ja asiakaspalvelun yhteydess.</p><h2>7 Tietojen snnnmukaiset luovutukset</h2><p>Asiakkaan henkiltietoja ei luovuteta weCan5 Oy:n lukuun toimivien tai palvelukokonaisuuden tuottamiseen osallistuvien kolmansien tahojen ulkopuolelle.</p><h2>8 Tietojen siirto EU:n tai ETA:n ulkopuolelle</h2><p>Psntisesti weCan5 Oy ei siirr tai luovuta asiakkaan henkiltietoja Euroopan unionin tai Euroopan talousalueen ulkopuolelle. Tietoja voidaan kuitenkin tarvittaessa siirt tai luovuttaa Euroopan unionin tai Euroopan talousalueen ulkopuolelle henkiltietolain sallimilla tavoilla mikli:</p><ul><li>tiedot siirretn maahan, jossa Euroopan komissio on todennut tietosuojan tason olevan riittv, tai;</li><li>sopimusjrjestelyin voidaan taata tietosuojan riittv taso, tai;</li><li>mikli asiakas on antanut siihen suostumuksensa.</li></ul><h2>9 Rekisterin suojauksen periaatteet</h2><p>weCan5 Oy:n rekisterin tietoturvallisuus sek henkiltietojen luottamuksellisuus, eheys ja kytettvyys varmistetaan tarkoituksenmukaisin teknisin ja hallinnollisin toimenpitein. Tietoja ja palvelua suojataan muun muassa palomuurin, fyysisten laitetilojen suojaamisen, kulunvalvonnan, kyttoikeuksien ja salaustekniikoiden sek edell mainittujen aktiivisen valvonnan kautta. Henkiltiedot suojataan asiattomalta psylt ja laittomasti tai vahingossa tapahtuvalta tietojenksittelylt.</p><p>Henkiltietoja ksittelevt vain weCan5 Oy:n erityisesti mrittelemt henkilt, jotka ovat yhtin palveluksessa, sek weCan5 Oy:n toimeksiannosta palveluja yllpitvt tai kehittvt kolmannet osapuolet. Nm tunnistautuvat jrjestelmiin henkilkohtaisen kyttjtunnuksen ja salasanan avulla.</p><p>Sovelluksien tietoliikenne on salattua ja asiakas tunnistaa kyseisen palvelun osoitteen oikeellisuuden varmenteesta.</p><h2>10 Tarkastusoikeus</h2><p>Asiakkaalla on henkiltietolain 26  28 :n mukaisesti oikeus tarkastaa, mit hnt koskevia tietoja rekisteriin on tallennettu. Joidenkin tietojen saamista on kuitenkin rajoitettu mm. rikosten ehkisemisen ja selvittmisen vuoksi.</p><p>Asiakas voi tarkistaa perustietonsa sek tapahtumatietojaan osittain mys tunnistautuneena palveluihin. </p><p>Tarkastuspyynt tehdn toimittamalla kirjallinen ja allekirjoitettu tarkastuspyynt osoitteella: weCan5 Oy, y-tunnus 2082238-6, osoite c/o Renesans Consulting Oy, Kasarmikatu 36, 00130 Helsinki.</p><p><p>Tarkastuspyynnss tulee mainita nimi, henkiltunnus, postiosoite ja puhelinnumero. Tarkastuspyynnn vastaus toimitetaan asiakkaan varmennettuun osoitteeseen.</p><h2>11 Oikeus vaatia tiedon korjaamista</h2><p>Asiakkaalla on oikeus: </p><ul><li>tarkistaa, pivitt, poistaa ja korjata henkiltietoja;</li><li>peruuttaa suostumus, jos henkiltietojen ksittely perustuu suostumukseen;</li><li>vastustaa henkiltietojen ksittely;</li><li>vaatia rajoittamaan henkiltietojen ksittely; ja</li><li>saada henkiltietonsa koneluettavassa muodossa ja siirt kyseiset tiedot toiselle rekisterinpitjlle edellytten, ett olet toimittanut kyseiset henkiltiedot meille ja ett ksittelemme henkiltietojasi suostumuksesi perusteella. Voit esitt edell mainittuja oikeuksia koskevan pyyntsi ottamalla meihin yhteytt henkilkohtaisesti, kirjeitse tai shkpostitse tmn tietosuojaselosteen kohdassa 2 ja 10 annettuun osoitteeseen. Voimme pyyt sinua tarkentamaan pyyntsi kirjallisesti ja varmentamaan henkilllisyytesi ennen pyyntsi ksittelemist.</li></ul><p>Jos et ole tyytyvinen siihen, miten ksittelemme henkiltietojasi, sinulla on oikeus tehd valitus toimivaltaiselle valvontaviranomaiselle, joka valvoo henkiltietojen ksittelyyn sovellettavan lainsdnnn noudattamista.</p><h2>12 Evsteiden ksittely</h2><p>Jos et hyvksy evsteiden kytt, voit poistaa ne kytst selaimen suojausasetuksista. Voit mys asettaa selaimen asetukset siten, ett saat varoituksen joka kerta, kun verkkosivusto yritt tallentaa evsteen tietokoneellesi. Aiemmin tallennetut evsteet voi mys poistaa selaimen kautta.</p><p>Selaimen ohjesivuilla on lis tietoa selaimeen tallennettujen evsteiden tarkastelusta, niiden poistamisesta sek evsteiden hyvksymiseen liittyvien asetusten tekemisest.</p></p>', 'fi', '2018-08-30 08:13:46.735543', '2018-08-30 08:13:46.735543', false);
