INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (504, 1, '<h2>Greetings from weCan!</h2><p>We invite you to fill a survey regarding your workplace here:</p><p><a href="{{ surveyLink }}">weCan Survey</a></p><p>The survey will take about 20 minutes.</p><p>Best,<br/>weCan<br/>www.wecan5.com</p>', 'en', '2018-08-30 08:13:47.527770', '2018-08-30 08:13:47.527770', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (506, 1, '<h2>Hei!</h2><p>Kutsumme sinut vastaamaan typaikkakyselyyn tll:</p><p><a href="{{ surveyLinkFI }}">weCan Kysely</a></p><p>Kyselyyn vastaaminen vie noin 20 minuuttia.</p><p>Kiitos,<br/>weCan<br/>www.wecan5.com</p>', 'fi', '2018-08-30 08:13:47.527770', '2018-08-30 08:13:47.527770', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (507, 2, 'You must be at least 18 years old to answer the survey.', 'en', '2018-08-30 08:13:47.579182', '2018-08-30 08:13:47.579182', false);
