INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (405, 541, '<p>Ota kantaa vittmiin sen mukaisesti, mit viimeisten viikkojen aikana olet ajatellut. Yleens paras vastaus on se, mik ensimmisen tulee mieleesi. Jos et tyskentele osana tiimi, kyt tarkastelukohteena koko organisaatiota.</p>', 'fi', '2018-08-30 08:13:46.735543', '2018-10-08 11:21:41.637000', false);
INSERT INTO multilingual_phrase (id, key_id, message, locale, ctm, mtm, archived) VALUES (371, 507, '<p>Vittmiss on kytetty kolmea eri nkkulmaa: sin yksiln, lhin tiimi tai ryhm johon kuulut, sek koko organisaatio. Kyt nkkulmana aina omaa tiimisi mikli vittmss ei toisin mainita.</p><p>Suosittelemme vastaamaan koko kyselyyn kerralla. Aikaa vastaamiseen kuluu yleens noin 20 minuuttia.</p><p>Kun olet ensin vastannut perustietoihin, pset aloittamaan varsinaisen kyselyn.</p><p>Kaikki vastaukset ksitelln luottamuksellisesti. Kukaan ei myskn missn vaiheessa pse nkemn vastauksiasi yksittisiin vittmiin.</p>', 'fi', '2018-08-30 08:13:46.735543', '2018-10-08 11:24:47.455000', false);
